(319, 'Coastal City Ballet Presents: Fall for Ballet', ' <p><strong>Presented by:</strong> Coastal City Ballet<br><strong>Date: </strong>November 26th, 2016 at 8pm, in the Grosvenor Theatre at the Kay Meek Centre<br><strong>Tickets:</strong> $30 Adults, $22 Seniors/Students/Children, $20 Groups of 10+ (per ticket)<p>With acclaimed and sold out shows last spring, Coastal City Ballet opens its 6th season with Fall for Ballet. Vancouver’s premiere repertory ballet company features locally trained and international dancers in an affordable and family-friendly evenin', 'http://vancouver.eventful.com/events/coastal-city-ballet-presents-fall-ballet-/E0-001-096892899-3?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 82);
