(320, 'JESSIE FARRELL: FREE COMMUNITY EVENT', ' <p> JESSIE FARRELL<br> Monday, February 13th, 2017 at 2:00pm<br> Family Day<br>  West Vancouver Community Centre<br> Free Admission<p> Featuring the music from her childrene#39s music album, equotTake Me Outsideequot.<br> The catchy and whimsical songs are featured in a kidse#39 CBC television series equotScout e The Gumboot Kids.equot Inspired by motherhood and her own childrene#39s imagination, Jessie has expanded from her award-winning country music roots to lively musical storytelling for her yo', 'http://vancouver.eventful.com/events/jessie-farrell-free-community-event-/E0-001-097017643-2?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 82);
