(437, 'Formation de Vente Kantech à Montréal', ' Durant la formation, les participants apprendront les notions de base pour vendre un projet de contrôle de#39accès et comprendre les solutions KANTECH. Au terme de cette formation de vente KANTECH, les participants seront à le#39aise avec les notions et principes requis se distinguer lors de la présentation de#39une solution de contrôle de#39accès. Ils seront également en mesure de répondre aux questions et aux objections les plus fréquemment posées par leurs clients lors du cycle de vente de#39un pro', 'http://montreal.eventful.com/events/formation-vente-kantech-/E0-001-090721705-4@2016113008?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 122);
