(438, 'VentureLAB- The B2B Sales Process November 3, 10 e', ' The B2B Sales Process  (3 sessions, 4 hours each) Entrepreneure#39s Toolkit Workshops are experiential, hands-on workshops facilitated by experienced entrepreneurs. The workshops offer ventures tools, mentoring and peer feedback to solve specific problems and develop essential business components.  In each four-hour session you will generate a deliverable that you will use frequently in the business development process. What will you get out of the B2B Sales Process workshop series?   Workshop Schedule  N', 'http://toronto.eventful.com/events/venturelab-b2b-sales-proc-/E0-001-089062717-7@2016111008?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '04:00' HOUR TO MINUTE, NULL, 67);
