(527, 'PLAYING WITH CHOIR', ' Do you love to sing (even though you might not consider yourself “a singer” or only feel comfortable singing alone in the car)? Singing in a group has significant benefits whether you’re on key or not – science says it’s like “an infusion of the perfect tranquilizer, the kind that both soothes your nerves and elevates your spirits.” PLAYING WITH CHOIR is an opportunity to come together in a large group to learn simple 2 or 3 part harmonies for popular songs of today and past decades and belt them out for t', 'http://eventful.com/events/playing-choir-/E0-001-096757797-8@2016111019?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 0);
