(530, 'Fall 2016 Okotoks Library -Toddler Time', ' Registration Begins August 29, 2016 - 9:00 am Register online www.litforlife.com or call 403 652-5090 Children ages 24 up to 36 months years with parent/caregiver are welcome.  Spend quality time with your toddler together learning language through rhymes, songs, age appropriate games and stories.  There is no cost for this program, however, Literacy for Life greatly relies on donations from people like you.  Thank you!  Facilitators: Bonnie Dates: (10 sessions)  Sept. 21, 28,Oct.5,12,19,26, Nov. 2,9,16,23', 'http://calgary.eventful.com/events/fall-2016-okotoks-library-to-/E0-001-096115859-5@2016111010?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:30' HOUR TO MINUTE, NULL, 31);
