(535, 'From Far e Wide - O Canada', ' This concert will feature works by Canadian composers and arrangers. From rollicking folksongs from the Maritimes to lush sacred works by iconic composers like Imant Raminsh and Healy Willan. We will present Songs for a Prospector by Stephen Chatman My Hearts in the Highlands by David Millard Stan Rogerse#39 equotMake and Break Harbourequot arranged by Ron Smail with special choreographed offerings from the Abbotsford Youth Orchestra and a grand finale set of songs for orchestra and choir including w', 'http://vancouver.eventful.com/events/far-wide-o-canada-/E0-001-097057715-4?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '03:00' HOUR TO MINUTE, NULL, 0);
