(536, 'NaNoWriMo Write', ' <p>Need a quiet place to write? Come “write” in! Join us every week for a scheduled writing session. Enjoy refreshments and a change of scenery with other writers.<p>NaNoWriMo is a fun and intense approach to creative writing. Participants work toward the goal of writing a 50,000-word draft during the month of November. Valuing enthusiasm, determination, and a deadline, NaNoWriMo is for anyone who has ever thought fleetingly about writing a novel.</p></p>', 'http://eventful.com/events/nanowrimo-write-/E0-001-097044766-8@2016111210?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 63);
