(537, 'The Western Canadian Premiere of "DETROIT" by Lisa', ' With director Lois Anderson at the helm, Mitch and Murray Productions returns with another dynamite play, Lisa De#39Amoure#39s Detroit, running November 4th to 19th at Studio 16. The Story: In Detroit, suburbanites Ben (Joel Wirkunnen) and Mary (Jennifer Copping) fire up the backyard grill to welcome the new neighbours, recovering addicts Sharon (Luisa Jojick) and Kenny (Aaron Craven), who have moved into the long-empty house next door. The fledgling friendship soon veers out of control, shattering the f', 'http://vancouver.eventful.com/events/western-canadian-premie-/E0-001-097058277-6@2016111020?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '48:00' HOUR TO MINUTE, NULL, 82);
