(760, 'Jacob Marley''s Christmas Carol, by Tom Mula', ' Follow Jacob Marleye#39s heroic behind-the-scenes efforts to save the soul of Scrooge, everyones favorite curmudgeonand in the process, save his own. This irreverent, funny and, ultimately, deeply moving story retells Dickense#39 Christmas Carol with warmth and infectious zest. Its great fun, an audience pleaser filled with laughs and capped with, of course, a happy ending...among the best evenings of the theatrical year! Chicago Tribune DEC 10: live-description performance for the partially sighted and ', 'http://vancouver.eventful.com/events/jacob-marleys-christmas-/E0-001-097119538-2@2016120119?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 59);
