(781, 'PAST YOUR BEDTIME Presented by Andrew Phung and Re', ' Whate#39s in store for late night audiences? Surprise guests, new show formats, more juicy questions, and a hilarious night of improvised comedy! Grab a beer, take a seat, and laugh your week off with us. Featuring: Andrew Phung, Renee Amber, Ali Froggatt, Anyssa McKee, Sean Allen, Emma Ross, Alexa McKell, Michael Roik, Ellis Lalonde, Ayla Stephen, Covy Holland, and more. We do not recommend our evening shows for younger children, as we cannot guarantee the language or content will be appropriate. PLEASE ', 'http://calgary.eventful.com/events/past-your-bedtime-present-/E0-001-097107194-9@2016112522?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 28);
