INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1110, 'Peter Asher Memoir', ' <a href="http://hughsroom.com/wordpress/wp-content/uploads/2016/10/13316b_7e13a72de77dcef57bf1f056e6058482.jpg" rel="nofollow"></a><p><a href="http://peterashermusic.com/" rel="nofollow"><strong>Peter Asher</strong></a>, CBE was born in London June 22, 1944, the son of a doctor and a professional musician.  He was educated at Westminster School in London and at Kings College, London University, where he studied philosophy.<p>Peter’s entry into the world of the performing arts was as a child actor.  At the ', 'http://toronto.eventful.com/events/peter-asher-memoir-/E0-001-097037378-9?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 0);
