(1316, 'The Choir of King’s College Cambridge', ' The Choir of King’s College, Cambridge is undoubtedly one of the world’s best known choral groups every Christmas Eve, millions of people worldwide tune into A Festival of Nine Lessons and Carols, a service that has been broadcast by the BBC since 1928. While the Choir exists primarily to sing the daily services in King’s College Chapel, its international fame and reputation, enhanced by an extensive recording catalogue, since 2012 on their own label, has led to invitations to perform around the world.<p>', 'http://vancouver.eventful.com/events/choir-kings-college-cambridge-/E0-001-096867562-0?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 59);
