(1328, 'to have e to hold – the physical book: more than a', ' An Exhibition by Penny Parry Within the next few generations, how many physical experiences will be traded in for virtual ones?  More to the point, what might we as humans lose – how might we change in our basic nature, in such a headlong rush to embrace the virtual?  This mixed media installation will challenge this thought by offering aspects of the ‘physical book experience’ that sharpen and feed our senses. Penny Parry likes to play with ideas.  Her work is based in photography and narrative.  For many', 'http://vancouver.eventful.com/events/have-hold-physical-bo-/E0-001-096508318-3@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 82);
