(1389, 'FKT16PBAD Portfolio for Art/Architecture/Design (1', ' Saturdays 10 weeks/30hrs Portfolio Courses are intended for students who are applying for admission to programs where they are required to submit a portfolio of their art work. This includes both high school visual arts programs as well as post-secondary programs  such as Fine Arts, Architecture, Illustration and Design, including Graphic Design and Advertising, Interior, Fashion and Industrial Design, Environmental Design, Design for Theatre, Video and Installation, Illustration, Animation, and/or any oth', 'http://toronto.eventful.com/events/fkt16pbad-portfolio-artar-/E0-001-096097327-0@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '48:00' HOUR TO MINUTE, NULL, 82);
