(1390, 'FA16MM Mixed Media (B/I/A) with TBD', ' Tuesdays 9:30am-12:30pm for 11weeks/33 hrs This course is materials /techniques based. Roll up your slieves and get your hands dirty while splashing and slashing, pulling and pushing. Unleash your creativity under the gentle guidance of a professional artist/art instructor. Explore and create in a fun, loosley structured, and alvays supportive studio environment. ', 'http://toronto.eventful.com/events/fa16mm-mixed-media-bia-tb-/E0-001-095984202-6@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '03:00' HOUR TO MINUTE, NULL, 82);
