(1391, 'FA16OMT Oil Media and Techniques (B/I) with Mahmou', ' Mondays 6:30pm-9:30pm 9 weeks/27hrs This class will teach and demonstrate hands-on the traditional oil painting techniques used by the old masters in order to create luminous paintings of still life, portrait, figure, or landscape. From preparing and priming of canvas, palette organizing and mixing of skin tone, to proper use of mediums, through underpainting, layering, glazing and scumbling techniques, you will learn the painting process step-by-step from start to finish. The objective is to produce one c', 'http://toronto.eventful.com/events/fa16omt-oil-media-and-tec-/E0-001-095984102-7@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '03:00' HOUR TO MINUTE, NULL, 82);
