(1392, 'FA16APT Acrylic Painting Techniques(B/I/A) with TB', ' Wednesdays 1:00-4:00pm for 10 weeks/30hrs This course will focus on the medium of Acrylic and ite#39s painting potential. Students will be introduced to various acrylic materials, such as gels, emulsions, pastes, retarders, extenders and so on. Techniques will be demonstrated and applied while painting on different grounds. Brushes and palette knives will be discussed and their uses demonstrated. By the end of this course students should be quite comfortable executing a more complex acrylic compositions, ', 'http://toronto.eventful.com/events/fa16apt-acrylic-painting-/E0-001-095983855-5@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '03:00' HOUR TO MINUTE, NULL, 82);
