(1393, 'FA16ULP Urban Landscape Painting (B/I/A) with TBD', ' Tuesdays 6:30-9:30pm for 9 weeks/27hrs If you look at the urban scape and sense ite#39s soul, or see a kind of beauty that triggers an emotional response, this class is for you. Urban landscape or urban scape, can be many things, as one can find many different things within a city. Students will work from photographs, preferably their own, of urban scenes. The process will include constructing the composition, deciding on a focal point, and choosing scale, size and technique. Instructor will help you by g', 'http://toronto.eventful.com/events/fa16ulp-urban-landscape-p-/E0-001-095983886-5@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 82);
