(1395, 'FA16W-CAC Be a Curator/Art Conservator with Srebre', ' Thursdays,  6 weeks/12 hrs Learn what a curator and what an art conservator do. They both take care of artworks but in a vastly different approach. The work of a curator is mostly visual, to display in a given space works of art to their fullest advantage. The art conservator is concern about proper handling, display, storage etc. in order to prolong the longevity of  artworks. Students will learn how to mount an exhibition, how to frame, hung and/or make small repairs when professional assistance is not a', 'http://toronto.eventful.com/events/fa16wcac-curatorart-conse-/E0-001-096667443-2@2016111016?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 82);
