(1398, 'FA16MSP Miniature Scale Painting (B/I/A) with TBD', ' Saturdays 1:00-4:00pm 11 weeks/33hrs  There is a long tradition of miniature scale painting throughout art history. This course will adress the historical perspective and some important examples from different periods will be discussed in the class. The scale of the painting plays a major role in miniature art, so it is important to pick the right subject matter and execution in order to create interest. Composition and concept development, along with colour use and application will be discussed with each ', 'http://toronto.eventful.com/events/fa16msp-miniature-scale-p-/E0-001-096658579-4@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '48:00' HOUR TO MINUTE, NULL, 82);
