(1399, 'FA16PAR Plein Air at Rosetta McLain Gardens (B/I/A', ' Monday 9:30am-12:30pm, for 6 weeks /18 hrs  The Mighty 8 x 10 Plein Aire Landscape Painting Plein Air painting is an exciting method of painting outdoors directly from your subject to express the fleeting effects of light, structure, colour. The small, but mighty 8 by 10 sketch has a tremendous ability to hold vitality because of ite#39s small size which naturally highlights confident and bold painterly approaches. It is suitable for small trips and for on hikes and relaxing visits to the park. This class', 'http://toronto.eventful.com/events/fa16par-plein-air-rosetta-/E0-001-096014973-0@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '24:00' HOUR TO MINUTE, NULL, 82);
