(1406, 'FA16PP Pet Portraits (B/I) with Jane Mikas', ' Wednesdays 2:30-4:30pm,   9 weeks/18hrs Pets are cherrished, taken care of, huged, kissed, enjoyed, photographed.  Bring in a favourite photo of your pet and learn how to paint your pete#39s portrait. You can choose to use oil, acrylic or watercolours. The instructor will guide you in a step by step, one to one approach, in the process from sketching to the final painting. This is a fun course full of love and positive energy. A perfect escape during the darker, shorter days of fall and winter. ', 'http://toronto.eventful.com/events/fa16pp-pet-portraits-bi-j-/E0-001-096658570-3@2016111014?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:30' HOUR TO MINUTE, NULL, 122);
