(1431, 'FA16FBS Floral and Botanical Studies (B/I/A) with ', ' Fridays 9:30am-12:30pm 6 weeks/18hrs This is a hands-on course for those who wish to strengthen and significantly develop their perception and observation skills. Locations such as Rosetta McLain Gardens will be explored and painted when ever possible. Good drawing skills are welcome but not required, as those will develop in the process. The objective is to finish at least two detailed observational watercolour studies of a single flower and/or plant, and at least one floral/botanical more complex composi', 'http://toronto.eventful.com/events/fa16fbs-floral-and-botani-/E0-001-095984003-7@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 82);
