(1432, 'FA16DPVM Drawing and Painting of Various Motifs (B', ' Thursdays 6:30-9:30pm 10weeks/30hrs Students will learn How to start drawing and painting and how to build an artwork Using various material: charcoal, pen, pencil, ink, oil  chalk pastel, acrylic paint, oil paint, watercolour, collage and mixed media. Students will learn to understand various medium through experimenting variety of technique and style, from traditional to modern art approach through various thematic/motive.  ', 'http://toronto.eventful.com/events/fa16dpvm-drawing-and-pain-/E0-001-095983995-2@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '02:00' HOUR TO MINUTE, NULL, 82);
