(1433, 'FA16WP Watercolour Painting (B/I/A) with Marija Ba', ' Tuesdays 9:30am-12:30pm for 11 weeks /33hrs Traditional Watercolour requires utmost discipline and focus in order to succeed. It does not tolerate mistakes very well, and trying to recover from them is mostly useless. However, a fast evolving modern technology has also affected the paint industry, creating new materials and changing and altering the properties of existing ones. As a result the medium of watercolour has also changed, allowing it to be much more forgiving and versatile, opening up exciting n', 'http://toronto.eventful.com/events/fa16wp-watercolour-painti-/E0-001-095984014-3@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '02:30' HOUR TO MINUTE, NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1434, 'FA16PPH Painting from Photographs (B/I) with Marij', ' Wenesdays 9:30am-12:30pm for 10 weeks/27 hrs As you probably know from experience, it is not simple to paint from a photograph, as the result is often a disappointing flatness and dullness. This course teaches what it takes to translate a photo image into a painting composition. You will learn hands-on how to “read” the photo, and how to select and correctly interpret the visual information captured by the camera. You can work in a medium of your choosing, while it is strongly recommended to carry and use ', 'http://toronto.eventful.com/events/fa16pph-painting-photogra-/E0-001-096078245-6@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '04:00' HOUR TO MINUTE, NULL, 82);
