(1435, 'FA16DB Drawing Basics (B/I) with Ashley Johnson', ' Wednesdays 9:30am-12:30pm 9 weeks/ 27hrs Hands-on studio-based course for beginners and those who feel that they need a refresher or improvement of their basic drawing skills. In structured step-by-step studio-based exercises designed to develop your technique as well as your perception and observational skills, you will practice using pencil, charcoal, conte, and graphite sticks on paper. Through guided practice you will learn how to achieve the illusion of depth and distance through line, scale, perspect', 'http://toronto.eventful.com/events/fa16db-drawing-basics-bi-/E0-001-095983984-6@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '24:00' HOUR TO MINUTE, NULL, 82);
