(1437, 'FA16DE Drawing Exploration (B/I/A) with Ashley Joh', ' Tuesdays 1:00-4:00pm for 10 weeks/30hrs Drawing is so fundamental to human experience that we done#39t even think about it much. Kids draw before they learn to speak, and drawing is the first form of creative expression for a child. As we grow up we often forget how much fun drawing can be. This course will shed light on some traditional approaches to formal drawing, but it will mainly show and inspire a more contemporary expression based on the use of line. We will discuss how some drawing materials evol', 'http://toronto.eventful.com/events/fa16de-drawing-exploratio-/E0-001-095983891-7@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 82);
