(1438, 'FA16FPDL Figure and Portrait Drawing from Life (B/', ' Wednesdays 1:00-4:00pm 10 weeks/30hrs, model fee included The focus of this course is on exploring ways to capture form, movement and expression working with a live model. We will study short gestures, as well as longer and sustained poses. The course will cover skeletal and musculature aspects of anatomy, as well as basic portraiture. This course is ideal for students wanting to strengthen observational skills, and pursue figurative painting, portraiture, fashion, illustration or animation. Materials list', 'http://toronto.eventful.com/events/fa16fpdl-figure-and-portr-/E0-001-095983881-0@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '02:30' HOUR TO MINUTE, NULL, 82);
