(1439, 'FA16IML Impressionist Landscape (B/I/A) with Olga ', ' Tuesday 1:00-4:00pm 11weeks/33hrs Colour owes it’s existence, and it’s appearance to light. Impressionist technique has resulted from the approach of trying to capture the observed impressions of colour affected by light, rather than the “real colour”. Paintings produced this way are dynamic, full of movement, and exceptionally beautiful. In this course students will work mainly from their own photographs depicting a scene with a strong sense of light and shadow. Emphasis will be on achieving a convincing ', 'http://toronto.eventful.com/events/fa16iml-impressionist-lan-/E0-001-095983864-3@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '04:00' HOUR TO MINUTE, NULL, 82);
