(1440, 'FA16CPH Collage and Photomontage (B/I/A) with Sreb', ' Thursdays 6:30-9:30pm for 9 weeks/30hrs Many artists adopted collage to eliminate texture and accentuate colour and shape. Students will be exposed to collages of Pablo Picasso, Jean Arp, Kurt Schwitters and others while encouraged to create their own, original design. Photomontage is a relatively recent attempt to join several images into a new composite. Often that “composite” was photographed to return it into a novel, seamless image. ', 'http://toronto.eventful.com/events/fa16cph-collage-and-photo-/E0-001-095983861-6@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 82);
