(1442, 'FA16CDT Classical Drawing Techniques (B/I/A) with ', ' Thursdays 1:00-4:00pm for 10weeks/30hrs In the Classical Drawing Techniques course students will learn how to use the lighting in the classical style, as the lighting is essential in the classical technique. In this course, students will identify how to cast lighting on the objects to create a tonality of classical atmosphere. ', 'http://toronto.eventful.com/events/fa16cdt-classical-drawing-/E0-001-095983856-4@2016111013?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 82);
