(1443, 'FA16OMT Oil Media and Techniques (B/I/A) with Mahm', ' Mondays 1:00-4:00pm for 9 weeks /27hrs, model fee included Portraiture is one of the most important and essential skills of the western visual art history. In this course students will learn how to approach  portraiture using equotwet-on-wetequot, or “alla prima” technique. Special focus will be on the use of large brushes which allow students to capture the expression of the model face. Materials list will be provided ', 'http://toronto.eventful.com/events/fa16omt-oil-media-and-tec-/E0-001-095983851-9@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 82);
