(1444, 'FA16CF Colour Fundamentals (B/I) with Jacqueline S', ' Mondays 9:30am-12:30pm for 6 weeks /18hrs This hands-on, studio-based, structured course is based in colour theory and the primary colour palette, and it teaches how to develop proficient and accurate colour mixing. The objective is to help students develop their ability to make intuitive choices regarding proper use and application of colour. You will get to know and be able to use with confidence the colour properties such as saturation, temperature, and value to create a sense of harmony in your work. ', 'http://toronto.eventful.com/events/fa16cf-colour-fundamental-/E0-001-096014863-4@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '02:00' HOUR TO MINUTE, NULL, 82);
