(1445, 'FA16ODP Observational Drawing and Painting (B/I) w', ' Mondays 6:30-9:30pm foe 10 weeks /30hrs For total beginners as well as for those with some drawing and painting experience. This course is designed to introduce students to formal approaches to still life. Through structured exercises in observation/ perception of elements such as lite, dark, texture, shape, form and distance, students will go from simple to more complex compositions. Foreground, mid ground and background, artificial horizon and a point of view, will be addressed, and basic aesthetic and s', 'http://toronto.eventful.com/events/fa16odp-observational-dra-/E0-001-095983849-4@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '48:00' HOUR TO MINUTE, NULL, 82);
