(1446, 'FA16APS Abstract Painting Studio(B/I/A) with TBD', ' Tuesdays 6:30-9:30pm for 11 weeks/ 33hrs This course will introduce the dynamic world of abstraction, also known as non-representational art. You’ll investigate and create works in different abstract genres, learning a wide variety of techniques, and using different approaches to achieve depth, mood, form, space and texture. Learn how to develop your own colour palette and subject matter through exercises in colour and composition. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16aps-abstract-painting-/E0-001-095983848-5@2016111018?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '06:00' HOUR TO MINUTE, NULL, 82);
