(1448, 'FA16APF Acrylic Painting Fundamentals (B/I) with A', ' Tuesday 9:30am-12:30pm for 10 weeks /30hrs You will be introduced to the process of painting using acrylic and acrylic gels and mediums. Acrylic is essentially plastic, and it is opaque by nature. In order to make it behave differently, and become glossy or transparent for example,  you need to use acrylic mediums. Acrylic is a water based paint,  easy to start using but it takes time to get to know it well and be able to manipulate it the way you want it. The course will teach some finer techniques and ap', 'http://toronto.eventful.com/events/fa16apf-acrylic-painting-/E0-001-095984146-1@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '06:00' HOUR TO MINUTE, NULL, 82);
