(1450, 'FA16IP Impressionist Painting (B/I) with Jane Mika', ' Wednesdays 9:30am-12:30pm for 9 weeks/27hrs Impressionist approach is a result of studying the effects of light on the appearance of colour. Paintings produced this way are dynamic, full of movement, and exceptionally beautiful. In this course students will work mainly from their own photographs depicting a scene with a strong sense of light and shadow. Emphasis will be on achieving a convincing sense of form, volume and spatial depth using a “colour priority” method of impressionist painting. Students wil', 'http://toronto.eventful.com/events/fa16ip-impressionist-pain-/E0-001-095984091-2@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 82);
