(1703, '2nd Global Summit on Cognitive, Psychological and ', 'Cognitive behavioral therapy meetings will provide an opportunity for all marketing societies working on psychology and behavioral psychiatry to talk about their work. Cognitive behavioral therapy conferences will congregate renowned speakers, investigators, Nobel laureates, psychiatry scientists and psychology researchers from both academia and health care industry will join together to discuss their views and research.', 'http://eventful.com/events/2nd-global-summit-cognitive-psycholo-/E0-001-094967497-6@2017050109?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '24:00' HOUR TO MINUTE, NULL, 23);
