(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1708, 'Mennonite Mass Choir Registration - Messiah', ' Optional note learning rehearsals and those new to Messiah and those wishing a refresher on September 12, 19 and 26. Regular rehearsals for all perticipants begin Monday, October 3rd. No rehearsal Monday, October 24th. Rehearsal director: Mark Diller Harder.  Tenors and basses, please see additional information for extra singing opportunity.  ', 'http://eventful.com/kitchener/events/mennonite-mass-choir-regis-/E0-001-093617057-7@2016111019?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:30' HOUR TO MINUTE, NULL, 0);
