(1709, 'Saturday Morning Walks - Sifton Bog', ' <ul><li></li></ul><br><p>Each walk will begin at 9:00 a.m. from the meeting place and will take approximately one hour. All walks are free. Come on out and enjoy walking the beautiful trails and parks within the City of London. Walks are free and last approximately one hour. Families with children are welcome, please leave dogs at home.<p>For more information call John Clark at 519-641-0442.<p><strong>Sifton Bog</strong><br> Northwest corner<br> Superstore parking lot<br> Oxford St., West of Hyde Park Rd.<', 'http://eventful.com/events/saturday-morning-walks-sifton-bog-/E0-001-094878171-0?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '24:00' HOUR TO MINUTE, NULL, 122);
