VALUES
(1784, 'Formations Concepteur et Consultant certifié "Pass', ' Formation pour Concepteurs et Consultants certifiés «Passivhaus».Cette formation complète, offerte en collaboration avec Maison passive France, est recommandée pour la préparation à le#39examen de le#39Institut equotPassivhausequot. Tous les cours ont lieu au Centre Saint-Pierre à Montréal selon le calendrier suivant: 17-18 septembre 2016: bloc A  Le standard « Passivhaus » (1/2 journée) Enveloppe du bâtiment (1 1/2 journée) 28-29-30 octobre 2016: bloc B  Ventilation bâtiment passif (2 jours) Productio', 'http://montreal.eventful.com/events/formations-concepteur-et-/E0-001-094533481-2@2016111009?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '02:30' HOUR TO MINUTE, NULL, 100);
