(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1785, 'Knowledge Integration seminar series', ' <p>INTEG 10 is a seminar on transdisciplinary topics and integrative practices which are of special interest to Knowledge Integration students.  This is the equotliving roomequot of the program a place where ideas come together.<p>We welcome friends and visitors!<p>Each session features a different guest speaker and is open to all students, faculty, staff, alumni and members of the public.  We encourage sparkling and lively discussion between speakers and audience members.<br><strong>Upcoming speakers</', 'http://eventful.com/events/knowledge-integration-seminar-series-/E0-001-096193815-9@2016111114?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '24:00' HOUR TO MINUTE, NULL, 75);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1786, 'Small Wonders: Gothic Boxwood Miniatures', ' <p>Marvels of human ingenuity, so small they can fit in the palm of your hand, miniature boxwood carvings from the early 1500s have long remained a mystery.The AGO is pleased to debut <b><i>Small Wonders: Gothic Boxwood Miniatures, </i></b>a groundbreaking exhibition of more than 60 boxwood miniatures organized in partnership withThe Metropolitan Museum of Art and the Rijksmuseum. Offering new insight into the methods of production and cultural significance of these awe-inspiring works of art, this exhibit', 'http://toronto.eventful.com/events/small-wonders-gothic-boxw-/E0-001-096192500-3@2016111000?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '02:00' HOUR TO MINUTE, NULL, 47);
INSERT INTO evenement
