(2013, 'Rosie e The Riveters', ' <br> Rosie e the Riveters are four fiercely talented and sassy dames from Saskatoon, Saskatchewan, who perform uplifting folk music with a vintage 1940s flair! Their original songs feature sophisticated harmonies, body percussion, scintillating dance moves, humour and just enough ooh-la-la to charm your socks off! Along with whoops, hollers, and mile-wide smiles, they create a sound and sight that is lighthearted and captivating for all music lovers.They are inspired by Rosie the Riveter, the feminist icon', 'http://eventful.com/winnipeg/events/rosie-riveters-/E0-001-097115159-1?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:00' HOUR TO MINUTE, NULL, 122);
