(2030, 'The Big Lie', ' While sitting around a table this spring, having an intimate group conversation, several of us began sharing our Big Lies....those untruths that we use as an excuse to stay stuck, remain indecisive and keep others comfortable, at the expense of our own individual happiness and potential. The outcome of this conversation was that many of us took the question equotWhat is your Big Lieequot with us to dinner parties, networking events, coffee dates and family dinners. The stories that came forth, the truths', 'http://calgary.eventful.com/events/big-lie-/E0-001-095878793-5?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '04:00' HOUR TO MINUTE, NULL, 54);
