(2228, 'Discover the Ocean as Never Seen Before in IMAX®', ' Narrated by renowned oceanographer Dr. Sylvia Earle, “Jean-Michel Cousteau’s Secret Ocean” is a breakthrough look at a secret world within the ocean that is perhaps the biggest story of all—that the smallest life in the sea is the mightiest force on which we all depend. Playing daily in stunning 4K Laser projection, visit imaxvictoria.com/movie/secret-ocean for additional information and the trailer.', 'http://eventful.com/events/discover-ocean-never-seen-before-imax-/E0-001-043110172-6?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '10:00' HOUR TO MINUTE, NULL, 37);
