(2232, 'Epiphany Explorations Conference', ' This annual conference brings together ministers, lay leaders and community members interested in social issues for four days of presentations and music. Topics include reconciliation with First Nations, a vision for a sustainable future, insights about love, grief, spiritual crisis and healing in the works of C.S. Lewis, the significance of medical assistance in dying for people of faith, and the common ground of science and faith. Speakers include Melanie Mark, Guy Dauncey, Thomas Attig, Jordan Cantwell,', 'http://eventful.com/events/epiphany-explorations-conference-/E0-001-042208658-6?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '01:30' HOUR TO MINUTE, NULL, 47);
