(2233, 'International Guitar Night', ' International Guitar Night (IGN)—The world’s foremost acoustic guitarists are brought together by IGN founder Brian Gore to perform their latest original compositions and exchange musical ideas in a public concert setting. For 17 years, International Guitar Night’s Brian Gore has invited a new cast of guitar luminaries from around the world to join him for special concert tours highlighting the diversity of acoustic guitar. International Guitar Night remains as one of the premiere performances that we pres', 'http://eventful.com/events/international-guitar-night-/E0-001-041991579-2?utm_source=apiseutm_medium=apimeutm_campaign=apic', INTERVAL '06:00' HOUR TO MINUTE, NULL, 63);
